function fuzzyQuery(str){
    let arr=[];
    list = eval(tickList);
    //console.log(list);
    str = str.toUpperCase();
    for(let i=0;i<list.length;i++){
        //match the code first
        if( (list[i].code).match(str) !=null){
            arr.push(list[i].code);
        }else if( ((list[i].name)).toUpperCase().match(str) !=null){
            arr.push(list[i].code);
        }
    }

    return arr[0];
};


